import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Book search</h1>
      </header>
      <body>
        <p id="A">Hola</p>
        <p id="A"><input type="text" name="autor"></input></p>
      </body>
    </div>
  );
}

export default App;
